<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8" />
    <title>ui5-extra Samples | Carlos Orozco</title>
    <script
      id="sap-ui-bootstrap"
      src="resources/sap-ui-core.js"
      data-sap-ui-resourceroots='{
	            "dev.carlosorozco.ui5Extra.samples": "./"
	        }'
      data-sap-ui-theme="sap_horizon"
      data-sap-ui-compatVersion="edge"
      data-sap-ui-oninit="module:sap/ui/core/ComponentSupport"
      data-sap-ui-async="true"
      data-sap-ui-xx-waitForTheme="true"
      data-sap-ui-xx-bindingSyntax="complex"
      data-sap-ui-xx-supportedLanguages="en,de"
    ></script>
  </head>
  <body class="sapUiBody">
    <div
      data-sap-ui-component
      data-name="dev.carlosorozco.ui5Extra.samples"
      data-id="container"
      data-settings='{"id" : "dev.carlosorozco.ui5Extra.samples"}'
    ></div>
  </body>
</html>
